import styled from '@emotion/styled';

export default function Header() {
    return (
        <HeaderStyled>
            <div className="container">
                <div className="logo-text">Home</div>
            </div>
        </HeaderStyled>
    )
}

const HeaderStyled = styled.header`
    background: ${props => props.theme.colors.primary};
    padding: 20px;

    .logo-text {
        color: #000000;
        font-weight: bold;
        font-size: 0px;
    }
`
